import React from "react";
import ReactDOM from "react-dom";
import logo from "./logo.png";

function Navbar() {
  return (
    <div className="nav">
      <div className="left-head">
        <img src={logo} className="react-logo" />
        <h2>ReactFacts</h2>
      </div>

      <h3>React - Project 1</h3>
    </div>
  );
}

export default Navbar;
